import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import homeData from './data/homes.json'; // Import your data from the JSON file

function HomeDetails() {
    const { id } = useParams();
    const [homeDetails, setHomeDetails] = useState(null);

    useEffect(() => {
        // Find the specific home details in the imported data
        const selectedHome = homeData.find((home) => home.id === id);

        // Set the home details in state
        setHomeDetails(selectedHome);
    }, [id]);

    if (!homeDetails) {
        return <div>Loading...</div>;
    }

    // Render home details when data is available
    return (
        <div>
            <h2>Home Details</h2>
            {/* Render home details using homeDetails */}
            <img src={homeDetails.image_url} alt={homeDetails.address} />
            <p>Price: {homeDetails.price}</p>
            <p>Address: {homeDetails.address}</p>
            <p>Registered: {home.registered}</p>
            <p>About: {home.about}</p>
            <p>Realtor: {home.realtor.first} {home.realtor.last}</p>
            <p>Email: {home.realtor.email}</p>
            <p>Phone: {home.realtor.phone}</p>
        </div>
    );
}

export default HomeDetails;
